import * as React from 'react';
import Booking from '../models/booking';

import { Input, Button,  } from '../common/components/form';

import {Text, Form, Color} from 'react-lifesg-design-system'
import { ThemeProvider, } from "styled-components";
import { Container, useTheme } from '@material-ui/core';

interface Props {
    booking: Booking;
    onChange: (fieldName: string, value: string) => void;
    onSave: () => void;
}

export const BookingForm: React.FunctionComponent<Props> = (props) => { 
    return (
        <Container>
            <div>

            </div>

            <h1>Create booking</h1>
            <h4 style={{ color : "#1C76D5" }}>Citizen Information</h4>

            <Form.Select
                label="Salutation"
                placeholder="Select"

                options={[
                    { value: "Mr", label: "Mr" },
                    { value: "Mrs", label: "Mrs" },
                    { value: "Miss", label: "Miss" },
                ]}
                valueExtractor={(item) => item.value}
                listExtractor={(item) => item.label}
                displayValueExtractor={(item) => item.label}

            />

            <Form.Field
                label="Name"
            />

            <Form.Field
                label="Citizen NRIC / FIN number"
            />

            <Form.Field
                label="Citizen phone number"
            />

            <Form.Field
                label="Email Address"
            />

        <h4 style={{ color : "#1C76D5" }}>Service   </h4>



        <Form.Select
                label="Service Name"
                placeholder="Select"

                options={[
                    { value: "Idk1", label: "Idk1" },
                    { value: "Idk2", label: "Idk2" },
                    { value: "Idk3", label: "Idk3" },
                ]}
                valueExtractor={(item) => item.value}
                listExtractor={(item) => item.label}
                displayValueExtractor={(item) => item.label}

            />

            <Form.Field
                label="Service Provider Phone Number"
                placeholder='Type here...'
            />

            <Form.Select
                label="Service Provider"
                placeholder="Select"

                options={[
                    { value: "Idk1", label: "Idk1" },
                    { value: "Idk2", label: "Idk2" },
                    { value: "Idk3", label: "Idk3" },
                ]}
                valueExtractor={(item) => item.value}
                listExtractor={(item) => item.label}
                displayValueExtractor={(item) => item.label}

            />

            <Form.Field
                label="Service Provider Email Address"
                placeholder='Type here...'
            />

            <Button
                label="Save"
                style= {Color}
                className="btn btn-success mt-2"
                onClick={props.onSave}
            />
        </Container>
    );
};
